import * as type from './types'
import actions from './actions'
const state = {
  reports: []
}

const mutations = {
  [type.SEARCH_NEW] (state, { payload }) {
    state.reports = [...state.reports, payload]
  }
}
export default {
  actions,
  state,
  mutations
}
